import {FETCH_COLLECTIONS} from './types'



export const getStandardDeck = () => {
    fetch('http://localhost:3000/collections/5')
    .then(res => res.json())
    .then((data) => {
        var prompts = []
        data.map((p) => {
            prompts.push(p.prompt)
        })
    })
    .then(res => console.log(res))
}
